// HasDownloadClient applies the HasEdge predicate on the "download_client" edge.
func HasDownloadClient() predicate.DownloadJob {
	return predicate.DownloadJob(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, DownloadClientTable, DownloadClientColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDownloadClientWith applies the HasEdge predicate on the "download_client" edge with a given conditions (other predicates).
func HasDownloadClientWith(preds ...predicate.DownloadClient) predicate.DownloadJob {
	return predicate.DownloadJob(func(s *sql.Selector) {
		step := newDownloadClientStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

